import { createRouter, RouterProvider } from '@tanstack/react-router';

// Definiowanie tras
const routes = [
  {
    path: '/',
    element: <Home />,  // Komponent wyświetlany na głównej stronie
  },
  {
    path: '/form',
    element: <Form />,  // Komponent formularza
  },
  {
    path: '/table',
    element: <Table />,  // Komponent tabeli
  },
];

// Tworzymy router
const router = createRouter({
  routes,
});

export { router, RouterProvider };
